import{_ as p,c as e,a as h,o as i}from"./app-CHiHTJW6.js";const o={};function s(t,a){return i(),e("div",null,[...a[0]||(a[0]=[h('<p>[[プログラミングエッセイ]]</p><p>サーファープログラマーというエッセイを書きたい気がしている。 最終的にはブログにして行くつもりだけど、最初は何書くか良くわかってないのでWikiに考えてる事を書き出してみる。</p><p>サーファーの特殊さとプログラマの特殊さの交わる所の話には面白さがあるんじゃないか、という気がしている。 プログラマしか分からない人がサーファーというものの話を見て遠い世界の話と楽しんだり、 逆にサーファーがプログラマの話を見て遠い世界の話と楽しめるような、そんな日常を描くエッセイ的なものを書いてみたい。</p><p>なお、タイトルではサーファーと伸ばすからプログラマもプログラマーと伸ばしてみたけど、文中ではプログラマにするつもり。</p><h2 id="サーフィン動画の楽しみ" tabindex="-1"><a class="header-anchor" href="#サーフィン動画の楽しみ"><span>サーフィン動画の楽しみ</span></a></h2><p>最近よくサーファーyoutuberの動画を見ている。これがなかなかおもしろい。</p><p>自分の親は昔からサーファーなので、自分が子供のころなど、夕飯の時などに良くサーフィンのビデオを見たりしていた。 子供の頃の自分は別段サーファーじゃないので、たぶん現在サーファーでもなんでも無い読者がサーフィン動画を見るのと同じような印象と思う。 大きな波に多少「お〜」とか思ったりもするけれどその程度で、それほど楽しいものとは思っていなかった。 だがサーフィンをある程度するようになると、サーフィン動画が非常に面白いものだと思うようになった。</p><p>サーフィンをやっていく上で、どういう波か、というのはすごく重要になる。 早い波、たるい波、掘れてる波、大きな波、小さな波。それらの条件でやるべき事が変わってきて、 合わない波の行動を取ってしまうと何も出来ずに終わる事になる。 だからサーフィンがあまりうまく無い自分などは、「こういう波の時はどうすればいいんだ？」という事がたくさんある。</p><p>そういう視点にたってサーフィン動画を見ると、それまで同じに見えていたサーフィン動画が一本一本違う価値を持っているように感じられるようになる。 動画の波は毎回違う波だし、動画ごとにコンディションの違う日となっている。 ある動画はこの前大きな波で全然自分が何も出来なかった日に似ている。 別の動画は今日乗った小さめの波と似ているが、自分が横に行くだけの所でこの動画ではちゃんとボトムターンして縦に上がるリップをしている。</p><p>そうやって自分の経験と照らし合わせて見るようになると、 サーフィン動画を見るのは一気に楽しくなる。 上手い人でも良く見るとスープに捕まっている事もあり、横に行き過ぎる事もあれば前に出過ぎる事もある。 なるほど、上手い人でも自分と同じような事は起こるのだな、とか思ったりする。 一方で自分が一本も乗れないようなコンディションでもちゃんとアクションを決めている事もある。 見るからに掘れすぎていて乗れないように見える波だが、なぜこういい感じに乗れるのだろうか？ テイクオフの場所だろうか？タイミングだろうか？乗ってからの動きだろうか？ そういう視点で見ると、上手さというのがより実感して感じられるようになる。</p><p>毎日乗っている動画がそのままコンテンツになり、マンネリとか飽きも無く見る側が楽しんで見られる。 サーフィンは録画が大変ではあるが、コンテンツ的にはyoutube向きだなぁ、と思う。 ギターレッスン系の動画は初期に言いたい事を言ってしまうとそのあとには更新に苦労している印象がある。 将棋実況は割と似た性質を持っていると思うけれど、実況すると普段より指し手が悪くなるので練習としてどうなんだ、という問題があるようにも思う。 サーフィンは１人では撮れないが、普段の楽しんでやるサーフィンがそのままコンテンツになり、なかなかおもしろいので、 動画用に行動を変えなくて良いというメリットがある気がする。 サーフィンは自然の状況が勝手に変化するので、映像的にマンネリ感が出にくいという側面もあるように思う。 しょぼい波の日もあればでかい波の日もある。 しかもそれがちょうど自分が体験したのと近い日に上がってくる。 「あー、これ一昨日のヤツだな。あの日は途中から良くなってきたんだよなぁ。」とか思いながら見ていると、 向こうは全然こっちの事を知らないのに仲間意識みたいなものも湧いてくる。</p><p>サーフィンは一本の波の時間が短いのもいい。 長い40分間ずっと中断出来ないという類のものじゃなくて、1分程度で終わる一本の波を見たら一旦一時停止して違う事が出来る。 簡単に区切れるので気楽に見れる。 試合とかは途中で切るといまいちだけれど、 それ故に試合の動画よりもフリーサーフィンのyoutuberによる動画の方がかえってコンテンツとしては良いという面白い現象もある。</p><p>サーフィン動画の良い所に、世の中のニュースと全然関係ない、という部分もある。 youtubeという現代的なインターネットメディアでありながら、twitterなどが一色になる時にも全く関係ない時間が流れる。 SNS上で見える「みんな」というのが思ったほど「みんな」でも無いと気付かされてくれたりもする。</p><h2 id="サーフィンとよい天気" tabindex="-1"><a class="header-anchor" href="#サーフィンとよい天気"><span>サーフィンとよい天気</span></a></h2><p>今日はいい天気で、江ノ島と富士山が良く見えた。いい天気だと気分が良い。</p><p>原理的にはサーフィンには天気は関係無い気もするが、 海から見える富士山の美しさは海の上で遊ぶ人だけが見れる景色でもあり、 これはサーフィンの楽しさの一部でもあると思う。</p><p>遠くの山が綺麗に見える、というのは、秋とか冬とか、空気が乾燥している必要がある。特に海の向こうに綺麗に見える為にはその傾向が強い。 夏は水蒸気が出てしまうので、どうしてもモヤがかかったような見た目になる。 一方で秋とか冬に見ると、山がくっきりと見えて、とても美しい。 さらにそれが下の海とのコントラストを描き、得も言われぬ絶景となる。</p><p>この素晴らしい景色は、秋や冬に海の上からしか見る事が出来ない。 夏にだけ海に入る人たちには見る事が出来ない、ちょっとした自分たちだけの秘密の贅沢。</p><p>そもそもサーフィンは海との距離が近いスポーツだ。 例えばヨットは水面から少し上に座る事になる。 SUPやウィンドサーフィンも水の上に立つ。 一方でサーフィンは、波を待っている間は水の上に座っている。体の半分以上は水に入っているので、 顔の位置が水面に近い。トップクラスに水面に近い状態を長時間維持するスポーツと言えるんじゃないか。 近すぎる分水の中は良く見えないので、SUPなどに比べると水の中の美しさを楽しむ度合いは少ないけれど。</p><p>距離だけでなく、風景を眺めている時間が他のスポーツより圧倒的に長い。 座って波を待っている時間がとても長いからだ。20分くらい何もやる事が無い事もある。 海の上でこれだけやること無く待たなくてはいけないスポーツも、他に無いんじゃないか。 SUPやカヤックは海の上で漕いで移動する。止まって風景を見たりする事はあるけれど、 強制的にしばらく止まらなくてはいけない、という事は無い。 サーフィンは波が無い間は出来る事が無いので、もう風景見るの飽きた、と思っていても止まっている必要がある。</p><p>そうやって長時間待たされるので、暇つぶしに良く山を眺めたり空を眺めたり海鳥を眺めたりしている。 特に湘南などいつも波がある訳では無い地域でサーフィンをやっている人たちは、多くの時間を波を待って過ごしている。 そもそもに3時間海に居て、波に乗っている時間なんて10分は無い。残りの半分は移動していて、残りの半分は座ってぼけーっとしている。 これがサーフィン。</p><p>波がある時は荒れている日も多いので、他のスポーツでは海に近づかないような荒れている日にも海に入るし、 綺麗で穏やかな日にも海に入る。海の荒れてる時と穏やかな時の両方に海に入るスポーツとしては、ウィンドサーフィン、サーフィン、カヤックあたりがトップクラスになると思う。 同じ場所の表情の違いが、より綺麗な日を特別に思わせるのかもしれない。</p><p>何にせよ、今日はいい天気だった。雪化粧した富士山も綺麗で、波も綺麗で、いい波だった。 最高の秋の一日だった。</p><h2 id="サーフィンの実力の曖昧さ" tabindex="-1"><a class="header-anchor" href="#サーフィンの実力の曖昧さ"><span>サーフィンの実力の曖昧さ</span></a></h2><p>今日はなかなか掘れてるボトムで深めのボトムターンが出来て、おぉ、これだよこれこれ、って感じだった。 最近サーフィン上手くなったのでは？という気もするのだが、意外と上手くなったかどうかが分かりにくいんだよな、サーフィンって。 今日はその辺の話をしてみたい。</p><p>サーフィンというのは、基本的に良い波にいい所から乗ってないと何も出来ない（少し言い過ぎだが）。 いい波というのは実力でも変わってくる所ではあるが、その人にとっていい波というのは確実にある。</p><p>で、いい波にいい所から乗る、というのは非常に奥の深いもので、プロ同士でも違いが大きく出るレベルで上限が無い。 初心者はいい波にいい所から乗るのは本当にたまにしか出来ない。そういうものだ。</p><p>さらに問題をややこしくするのが、波というのは日によっても場所によっても違う、という事。 自分の入っているポイントでは、乗れる波が全く来ないというハズレの場合もある。 この場合はどんなにサーフィンが上手い人でもいい感じの波にいい感じの場所から乗れる事はありえない。</p><p>普通のスポーツなどでは、新しい事というのは何回かに一回しか成功しない所から始まるだろう。 それでも一日やって一回出来る、となれば、それはまぁ多少は出来る、と言えるだろうし、それを繰り返してだんだんと成功率を上げていけば、上達というのも割と簡単にわかる。</p><p>でもサーフィンのある技について、いい感じの波にいい感じの場所から10回乗れたら一回は出来る、という場合、 これを調べるのは極めて難しい。 サーフィン初心者がいい感じの波にいい感じの場所から10回乗る、 というのは、ほとんどのケースで何日かかかる。一ヶ月でそれだけ乗れない月も珍しくない。 自分が10回に一回出来るかを確認するのはそれほどに難しい。 そもそもそれだけやっていると普通に実力が上がってしまっても不思議では無い。</p><p>ではある時、いい感じの波にいい所から乗れて、なんか技が出来たとする。 これがマグレなのか実力なのかは本人にも良く分からない。 いい感じの波にいい所からたまたま偶然乗れただけかもしれないし、 実力が上がった事でいい波に乗れる本数が増えたのかもしれない。 そして前からいい感じの波にいい所から乗れたら同じ事は出来ていたかもしれないし、 今回初めて出来るようになったのかもしれない。 技が出来たか出来ないかはっきりするケースならどちらか明らかに出来るが、 例えばバシッとリップでターンした、みたいなのはそう簡単でも無い。 自己認識と実際に出来ている事には結構違いがあるし、 バシッとターンする為にはバシっと当てる場所が必要で、 それはそういう波じゃないと出来ない。 たまたま波に乗ってたらちょうどそういう場所に偶然当たったのか、 波を読んでいい感じに合わせてそこにちょうど良く当てられたのかは本人にも分からない。</p><p>実力が上がっていれば、何週間かやっていると上手くいく事が何度か出てくるので、 上手くなったような気がするな、と判断出来る。 本当に上手くなっていれば、その分いい波のいい所から乗れる回数は増えるし、 回数が増えれば実力なのか偶然なのかも分かってくる。</p><p>ただこれも、たまたま良い波の日が続いたりいまいちな日が続いたりするので、そこまで確実には分からない。 最近全然いい感じに出来てないが、そもそも出来る波が全然来てないだけなのか、 それとも自分の実力がいまいちで良い波に乗れてないだけなのかは分からない。 さらにしばらく乗ってないと腕の力が落ちて波に乗る時に以前は乗れた波に乗れなくなっていたりもする。 この時にその日がいまいちなのか自分の実力が落ちているのかを判断するのも難しい。</p><p>という事で今日いい感じにボトムで深めのボトムターンが出来た気がするが、 これが上手くなった結果なのかたまたま偶然いい感じにボトムが目の前に来ただけなのかは良く分からないのだった。 分からないので、とりあえず上手くなったという事にしておく。</p><h2 id="サーファープログラマーの一日-海に出た場合" tabindex="-1"><a class="header-anchor" href="#サーファープログラマーの一日-海に出た場合"><span>サーファープログラマーの一日（海に出た場合）</span></a></h2><p>前日24:00。翌日の波予報などを見つつ就寝。この時、翌日波がありそうかどうかで翌日の行動が変わる。この時は、あるかもしれない、くらいの予報。</p><p>8:30 目覚めとともにベッドの上で、とりあえずライブカメラと予報を見る。予報は昨日より下がってて波が無さそう。 ライブカメラはちょうどポイントを映すのは無いので、隣の岬から数分に一回ちょっと写るのをじーっと待って見る。遠いのでスマホでは少ししか様子が分からないが、全く無いかそうでないかくらいはわかる。 何かあるような気がしないでも無い。</p><p>8:45 起きたあとはPCでライブカメラを見つつ朝食。チャットで海のそばに住んでいるサーファーの親族や友人達に波がありそうか聞く。 もう少しで乗れそう、とかいう返答が来るが、これはだいたいそうあって欲しいという思いが強すぎて見える幻覚なので、こういう返答の時はだいたい無い。 今日は労働するか。</p><p>9:50 1時間くらい仕事をしていた所、波があるとの連絡が。 あれ？朝見た時はなかったじゃん！ともう一度ライブカメラを見ると確かに結構ある。 予報では全然無いという事になっていたが… 潮を見ると干潮が10:40。これは一時間くらいで無くなりそうだが、12時ころにまた出てくるか？と一応海のそばの親のアパートに向かう。</p><p>10:10 親はすでに海に出ている模様。親の家のテレビのyoutubeでライブカメラを確認すると、なんか波が落ちているような… 浮力のある板で出てみる。</p><p>13:30 波はすぐ落ちてしまって、出ている間にも多少の上下はあるけれど基本的にはなかった。浮力のある板で出て正解だった。インサイドの浅い所で少しは乗れる。ただ浅いのでウニ踏んだりリーフで足を切ったりする。ぐぬぬ。 サーファーは自分と親族しかいないくらい誰も居ない。親族は普通にショートボードで出てきて乗れてない。全然波無いからね…</p><p>14:30 家に戻る。疲れ気味なので労働する気も起こらず、なろう読んだりピッコマで漫画読んだりしてグダグダする。 この時間が意外と長いんだよな〜。</p><p>17:00 なんか元気になってきたので軽く働く。この時間はあまり動いたりする気は無いが何か作業はしてもいい気分な事が多い為、面倒な仕事でも割と淡々と進める事が出来る。頭すごい使う仕事とかはダメだけど、面倒で手をつける気が起こらなかった事とかを進めるには結構良い。</p><p>19:30 夕飯を食べつつyoutubeでサーフィン動画などを見て意識を高める。なんか今日は3時間くらいしか働いてないな…まぁこんな日もある、と半日勤務という事にする（半日とは？）</p><p>そのあとはイタリア語をやったりブログを書いたりぐでぐでしたりする。</p><p>23:30 波予報を見て、今週はあんまり無さそうだな…という気分になって、伊豆とか奄美大島のサーフィン情報を調べたりしつつ就寝。</p><h2 id="サーファーとプログラマは相性が良い" tabindex="-1"><a class="header-anchor" href="#サーファーとプログラマは相性が良い"><span>サーファーとプログラマは相性が良い？</span></a></h2><p>フリーランスのプログラマはサーファーと相性が良い。 いらすとやでもフリーランスと言えばサーフィンしている。</p><p><a href="https://www.irasutoya.com/2014/11/blog-post_36.html" target="_blank" rel="noopener noreferrer">ノマドワーカーのイラスト - かわいいフリー素材集 いらすとや</a></p><p>なんでサーファーとプログラマはなんとなく相性が良い気がするのか。プログラマ側の事情はわかりやすい。 だいたい以下の２つの理由がぱっと思いつく。</p><ol><li>時間が自由で働きたい時に働ける</li><li>働く場所も自由で働きたい場所で働ける</li></ol><p>でもこれは、大抵の事に向いている特性と言える。 例えば水泳とかバスケットボールと比べて、何がサーフィンに向いている、と言えるのだろう？ その辺の事情を考えるには、サーファー側の事情を考えてみる必要がある。</p><h3 id="波が無いとサーフィンは出来ない" tabindex="-1"><a class="header-anchor" href="#波が無いとサーフィンは出来ない"><span>波が無いとサーフィンは出来ない</span></a></h3><p>サーフィンというのは、波が無いと出来ない。 当たり前に聞こえるかもしれないが、これが意味する事はサーファー以外にはなかなか伝わらない。</p><p>波というのは、いつもある訳ではない。 もっというと、めったに無い。 2週間とか3週間とか全然無い、なんて事も良くある。</p><p>そして波があるかどうかをあらかじめ予想するのは難しい。 ある程度は低気圧の位置から吹き込んでくる風の向きが予想出来て、 それによって波が立つか立たないかの予想は建てられるし、 それと干潮の時間と合わせると波が来るかもしれない、と思う日と、 波が無さそう、という予想は立つ。 だがこの予想はものすごく外れる。 しかも長期の予想は全然当たらない。 明日波がありそうかどうかはまぁまぁ予想出来ても、一週間後に波がありそうかどうかは本当に全く分からないと言って良い。 ３日後の予想くらいまではみんなしているけれど、サイコロよりもあたっているかはかなり怪しい。</p><p>しかも波があるという予想があたってもそれだけでは十分では無い。 サーフィンは、波があってさらに風が無い時が一番良いコンディションで、風が吹きすぎると実質出来ない。 でも波がある時は普通風が吹く。 だからサーフィンが出来るコンディションというのは、サーファー以外の人が思うよりもずっと少ない。 しかも風が吹くかどうかは本当に時間帯とかによって変わるので、 波がある日もサーフィンが出来るのは1時間とか2時間しか出来ない、という事も多い。</p><p>そんなのが典型的な日本の波という事になる。それが生活に与える影響を考えてみよう。</p><h3 id="波の確認の仕方" tabindex="-1"><a class="header-anchor" href="#波の確認の仕方"><span>波の確認の仕方</span></a></h3><p>波が無いとサーフィンは出来ない、と言った。 では波があるか無いかはどうやって確認するのだろうか？ なんと、一番良い方法は、実際に海に見に行く、というものだ。 そして結構多くのサーファーが、実際に見に行っている。 しかも一日に何度か行く事もある。</p><p>ライブカメラとか無いの？と思うかもしれないが、一応ある。これは大きなイノベーションですごく助かっている。 だが、自分のポイントをそのまま写すライブカメラは無い。隣のマリーナから数分に一回数十秒間だけ写されるのをじーっと見て判断する。 しかも波ってその数十秒はたまたま来てないだけでしばらく待ってると来る事もあるので、10分くらいぼけーっとライブカメラ見てないといけない。 なんか機械学習とかでライブ映像から目的の場所だけ切り取る機能とか作れないだろうか？とか考えるくらいこの作業は非生産的。 機械学習じゃなくても、リングバッファ的にここ10分の映像のうち特定の時間間隔で切り取ったのをずっと残してくれる、みたいなので十分なんだがなぁ。</p><h3 id="波は人間の都合で来てはくれない" tabindex="-1"><a class="header-anchor" href="#波は人間の都合で来てはくれない"><span>波は人間の都合で来てはくれない</span></a></h3><p>波は人間の都合を考えて来てくれる訳では無い。 それがリリース前日だろうと大晦日だろうと納会だろうとお盆の帰省シーズンだろうと三が日だろうとクリスマスだろうと関係ない。 人間の社会生活的に「その日はどうなの？」というような日にも来てしまう事がある。</p><p>当然、毎週火曜の15時からは来ないでください、 なんて事も言えない。 だから毎週火曜の15時にweeklyの定例ミーティングをしましょう、とか言うのと付き合うのはかなり難しい。</p><p>サーファーで無ければ毎週一回、30分程度のミーティングならいいんじゃないの？と思うかもしれないけど、 そこに波が来てしまってそこ以外には全く波が来ない、という事が普通に起こりうる。 波は干潮の前後2時間くらいに来る事が多いが、この干潮の時間というのは毎日変わるので、 定例というものとめちゃくちゃ相性が悪い。</p><p>もちろん波がいつもミーティングのタイミングに合わせていじわるして来る訳では無いので、 ミーティングが一つあるだけでサーフィンと共存出来ない、という訳では無いが、 そういうものは何も無い方が良い。波はめったに来ないので、波の来る日を優先したい。 別に波はめったに来ないのだから、それ以外の時間は結構たくさんある。 だがそれをどこに配置するかが選べないのだ。</p><p>定例じゃなければいいのか？というとそうでも無い。 ３日後は分からない、と言った。翌日なら多少は予想も効くが良くはずれる、とも言った。 では、「この機能について、Meetsで時間をあわせて打ち合わせしましょう、いつが都合がいいでずか？」 と聞かれたとしよう。 なんと答えるべきか？</p><p>明日波がありそうなら明日を避ける事は出来る。明日全然波が無さそうなら明日にスケジュールする事も出来る。 でもそれ以外のあるんだか無いんだか良く分からない日が続く時には、全くいつにすべきか分からない。 朝見たら午後にありそうかはまぁまぁ予想がつくが、相手がいつでも良いケース以外ではなかなか厳しい柔軟性が要求される。</p><h3 id="車とか金がそれなりにかかる" tabindex="-1"><a class="header-anchor" href="#車とか金がそれなりにかかる"><span>車とか金がそれなりにかかる</span></a></h3><p>プログラマが自由だ、というだけではなく、そこそこ給料が高い、というのもサーフィンと相性がいいと思う。</p><p>サーフィンというのは、趣味の中では比較的お金のかからないものとは言える。 ランニングとか水泳のプールよりは掛かるが、スポーツクラブなどとは同程度、 ダイビングやパラグライダー、スキーやスノボーなどよりはかからないと思う。 一番金がかからないというほどでは無いが、金が掛かるというほどでも無い。</p><p>ただ、それは家のそばにサーフスポットがあり、そこに波がある時だけサーフィンをする、という場合だ。 波はいつも同じ場所にある訳では無い。それどころか、どの場所もあんまり無い。 だから波がある場所に積極的に移動すれば、非常に多くの金が掛かるようになる。 明け方から車で千葉に向かう湘南のyoutuberなどは良く見られるが、 海ほたる渡って移動している事を思えば、一日一万円くらい掛かっているかもしれない（おっさんとしてはそれより4時起きで移動が無理だが…）。</p><p>飛行機の移動でも追加の料金が取られる場合もあり、宿もそれなりの広さが欲しくなり、レンタカーも必須となる。 バンコクに飛んでバスで移動して安宿で過ごすよりはだいぶお金が掛かる旅となる。 しかも着いた時に波が無いと何もできないので、それなりの日数滞在したくなる。 そういった点でも、サーフトリップは普通の旅行よりも少しお金が掛かる。</p><p>そういう訳で、ある程度まではお金を掛けると波に乗れる回数が増える。 だから時間があるだけではなく金銭的にある程度余裕がある、というのも、 プログラマがサーファーに向いていると思う所だ。</p><h3 id="街のそばには波はあまり無い" tabindex="-1"><a class="header-anchor" href="#街のそばには波はあまり無い"><span>街のそばには波はあまり無い</span></a></h3><p>人類は基本的に、海が荒れない所を選んで都市を作っている。 つまり都市のそばには波が無い。</p><p>だからサーフィンのスポットは住むのに不便な場所となるし、仕事もそばには無い事が多い。</p><hr><p>するとどうなるか？ 主に２つの戦略が考えられる。</p><ol><li>波が上がってくるのを期待してとりあえず海に入る</li><li>波の様子をずっと監視しつつ、波があったら海に入る</li></ol><p>海に入ると往復とシャワー浴びたりとかいろいろと、そもそも陸からサーフィンのポイントまでの移動などもあって、 何もせずに入って出てくるだけでも1時間くらい掛かる。 しかもそんな事はやりたくないので、普通は入ったらしばらく待ちたい。 だから2時間くらい掛かる。</p><p>とりあえず海に入る、という戦略は、とりあえず2時間くらい消費されるということになる。 そんな事を毎日やってたら、午前中と午後の両方を働くのは難しい。半日くらいしか出来ない。</p><p>さすがに毎日とりあえず海に入るのはどうなんだ、というのはあるけれど、</p>',83)])])}const d=p(o,[["render",s]]),m=JSON.parse('{"path":"/%E3%82%B5%E3%83%BC%E3%83%95%E3%82%A1%E3%83%BC%E3%83%97%E3%83%AD%E3%82%B0%E3%83%A9%E3%83%9E%E3%83%BC.html","title":"","lang":"en-US","frontmatter":{},"git":{"updatedTime":1672835590000,"contributors":[{"name":"Kazuma Arino","username":"","email":"hogeika2@gmail.com","commits":9}],"changelog":[{"hash":"79938e29d45bf8f5ff448e2aa06b6a08e7d06d66","time":1672835590000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"},{"hash":"71aefcdbddc9220e48591cfa4bcccd055940f7be","time":1672743791000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"},{"hash":"8e0d1d26cf770db3d3b01761a06a9f92b58a90eb","time":1669532277000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"},{"hash":"377a4edd4406b450a59aa3a33e2196dc2ed68de2","time":1669292329000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"},{"hash":"09e40ce0368dd8481891be8c81f571125164a00a","time":1668078101000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"},{"hash":"028851c05a24d4e8bebf3e0a591f89f66e2cd79a","time":1665205059000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"},{"hash":"85d45e4a2b57d2f632d09ab0447c6b301be80dbe","time":1664718262000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"},{"hash":"a513368342fbb67c02d390a3dfe59b273f5437e6","time":1664717737000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"},{"hash":"a45a73ab5c404bc197469c59fb574cd7559ee859","time":1664715470000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"}]},"filePathRelative":"サーファープログラマー.md"}');export{d as comp,m as data};
